  return (
    <>
      <div className="my-5">
        <h1 className="text-center">Contact Us</h1>
      </div>
      <div className="container cotact_div">
        <div className="row">
          <div className="col-md6 col-10 mc-auto">
            <form action=""></form>
          </div>
        </div>
      </div>
    </>
  );
};

export default Contact;
